import './resume.css';
import React from 'react';
import { Card, ListGroup } from 'react-bootstrap';
import fetch from 'isomorphic-unfetch';

const Resume = (resume) =>{

    console.log(resume);

    const job = (id) =>{
      return(
        <div className='job-one'>
          {id} <br></br> 
          <small>Contractor - Software Engineer </small>
        <ul>
          <li>Built home page, static pages, redesigned the Search page and respective components using Redux React and NextJS</li>
          <li>Refactored and restyled React components with modern ES6 syntax, SCSS and Redux React</li>
          <li>Added Selenium tests, using a chromium driver, to our codebase to test pull requests when they get created so we can automatically validate them before merging into staging or production</li>
          <li>Implimented a Pull Request template to our GitHub repository to help organzie and abstract the PRs</li>
        </ul>
        </div>
      );
    }

    return (
      <div className="container">
        <Card className="justify-content-center">
        <Card.Body>
          <Card.Title className="text-center"> Michael Di Paolo </Card.Title>
          <Card.Subtitle className="mb-2 text-muted text-center">Chicago, Illinois - notdipaolo@outlook.com</Card.Subtitle>  
            <Card.Text>
              <ListGroup variant="flush">
                <ListGroup.Item> 
                  <h5>Education</h5>
                    DePaul University <br></br> 
                    <small>Bachelor of Science in Computer Science - Software Development </small>
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Work Experience</h5>
                  {job('FoodBoss')}
                  {job('Anixter International Inc')}
                  {job('Chicago Transit Authority')}
                  {job('Illinois Tool Works')}
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Additional Industry Experience</h5>
                  {job('Futhead')}
                  {job('Deplay Solutions')}
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Relevant Coursework</h5>
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Projects</h5>
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Extracurriculars</h5>
                </ListGroup.Item>
                <ListGroup.Item>
                  <h5>Clubs</h5>
                </ListGroup.Item>
              </ListGroup>
            </Card.Text>
          <footer className="blockquote-footer">
           download here
          </footer>
          </Card.Body>
        </Card>
      </div>

    )
}

Resume.getInitialProps = async ctx => {
  const res = await fetch('./resume.json');
  const data = await res.json();

  console.log(`Show data fetched. Count: ${data.length}`);

  return {
    shows: data.map(entry => entry.show)
  };
}

export default Resume;
